                    caption: 'news-kmv.ru',
                    description: 'Национальными лепешками, песнями и зажигательной лезгинкой встретили в аэропорту «Магас» Ингушетии победителя XXXII Олимпийских летних игр по греко-римской борьбе в Токио Мусу Евлоева и участника Олимпиады Мусу Могушкова, передает корреспондент газеты «Ингушетия».        На церемонию чествования вернувшихся в республику спортсменов прибыли премьер Ингушетии Владимир Сластенин, родственники и друзья атлетов. Зажигательным национальным танцем встретил чемпиона главный хореографический коллектив республики — ансамбль национального танца «Ингушетия».    Премьер поблагодарил Евлоева за достойное представление страны на мировой арене, пожелал ему блестящих побед. Кортеж направился в столицу Ингушетии Магас. Автомобиль с олимпийцами сопровождали 10 байкеров, всадники конного клуба «Дикая дивизия» и несколько машин УГИБДД.    The post Ингушетия встретила победителя Олимпиады борца Мусу Евлоева first appeared on КМВ Новости.',
