        text: '- Подписал распоряжение о создании рабочей группы по рассмотрению вопроса размещения городского музея в здании по адресу ул. Московская, 72. «Доходный дом наследников В.Р. Максимова», построенный в 1899 году является объектом культурного наследия и в настоящее время находится в аварийном состоянии, - подчеркнул глава Администрации Ростова-на-Дону Алексей Логвиненко.<br><br>Жители города, общественность и архитектурное сообщество едины во мнении, что «Дом с ангелами» - именно так еще многие ростовчане его именуют, одно из самых красивейших зданий нашего города. Таким образом мы создадим не только музей Ростова-на-Дону , но реставрируем уникальный объект архитектуры.<br><br>На апрельском заседании городской Думы были выделены средства на определение достоверности сметной стоимости проектирования реконструкции здания музея, сейчас эта работа уже ведется, и мы ее завершим к 5 августа.<br><br>Первое заседание рабочей группы, на котором рассмотрим и утвердим техническое задание на проектирование реконструкции здания, проведем 3 августа.<br><br>После получения достоверности сметной стоимости и заключения рабочей группы мы выйдем с предложением к депутатам о выделении на августовском заседании городской Думы средств на проектирование и разработку ПСД.<br><br>#АлексейЛогвиненко<br>#ГлаваАдминистрации<br>#ГлаваАдминистрацииРостова<br>#РостовНаДону<br>#АдминистрацияРостоваНаДону<br>#Московская72<br>#МузейРостова',
