        text: 'Нашел место, где гуляют нижневартовцы и нижневартовки. На берегу озера.<br><br>Озеро среди местных считается грязным, поэтому купаются в нем только дети. Взрослые за ними наблюдают с берега.<br><br>На берегу есть огороженная зона для пьянства, которая в хорошую погоду заполняется битком. Зона состоит из кафе, танцпола, пары десятков беседок с мангалами и даже вертолета&#33; <br>Беседки арендуются за плату, и отдыхающие приходят туда на весь день со своим бухлом, мясом и закусками.<br>Беседки расположены в метре друг от друга, и каждый столик приносит свою колонку, чтобы перекричать соседние.<br>На все это действо есть одна грязная кабинка туалета, поэтому все кусты вдоль берега закиданы минами и бумажками.<br><br>Удивительно, но курить можно абсолютно везде. Даже в кафе на каждом столике стоят переполненные пепельницы. Очень много детей. Очень много курящих родителей обоих полов (около 100%)<br><br>В общем, маленький свободный мирок из давно утерянного прошлого.',
